import React, { useRef } from 'react'
import './style.css'
import './index.js'
import { useState } from 'react'

const Login = (props) => {
// const signUpButton = document.getElementById("signUp");
// const signInButton = document.getElementById("signIn");
const container = document.getElementById("container-login-login");
// console.log('signUpButton');
// console.log('signInButton');
if (signUpButton) {
	const signUpButton = () => {
		    container.classList.add("right-panel-active");
		};
}
if (signInButton) {
	const signInButton = () => {	
		    container.classList.remove("right-panel-active");
	}
}


// const signUpButton = () => {
//     container-login.classList.add("right-panel-active");
// };
// const signInButton = () => {
	
//     container-login.classList.remove("right-panel-active");
	


// }
// function handler() {
// 	container-login.classList.add("right-panel-active");
// }
// function handler2() {
//     container-login.classList.remove("right-panel-active");
// }



return (
   
    <>
<h2>Welcome to FreeWebsiteCode Sign in/up Form</h2>
<div class="container-login" id="container-login">
	<div class="form-container-login sign-up-container-login">
		<form action="#">
			<h1>Create Account</h1>
			<div class="social-container-login">
				<a href="https://www.facebook.com/FreeWebsiteCode/" class="social"><i class="fab fa-facebook-f"></i></a>
				<a href="https://twitter.com/freewebsitecode" class="social"><i class="fab fa-twitter"></i></a>
				<a href="https://www.linkedin.com/in/freewebsitecode/" class="social"><i class="fab fa-linkedin-in"></i></a>
			</div>
			<span>or use your email for registration</span>
			<input type="text" placeholder="Name" />
			<input type="email" placeholder="Email" />
			<input type="password" placeholder="Password" />
			<button>Sign Up</button>
		</form>
	</div>
	<div class="form-container-login sign-in-container-login">
		<form action="#">
			<h1>Sign in</h1>
			<div class="social-container-login">
				<a href="https://www.facebook.com/FreeWebsiteCode/" class="social"><i class="fab fa-facebook-f"></i></a>
				<a href="https://twitter.com/freewebsitecode" class="social"><i class="fab fa-twitter"></i></a>
				<a href="https://www.linkedin.com/in/freewebsitecode/" class="social"><i class="fab fa-linkedin-in"></i></a>
			</div>
			<span>or use your account</span>
			<input type="email" placeholder="Email" />
			<input type="password" placeholder="Password" />
			<a href="#">Forgot your password?</a>
			<button>Sign In</button>
		</form>
	</div>
	<div class="overlay-container-login">
		<div class="overlay">
			<div class="overlay-panel overlay-left">
				<h1>Welcome Back!</h1>
				<p>To keep connected with us please login with your personal info</p>
				<button class="ghost" id="signIn" onClick={signInButton}>Sign In</button>
			</div>
			<div class="overlay-panel overlay-right">
				<h1>Hello, Friend!</h1>
				<p>Enter your personal details and start journey with us</p>
				<button class="ghost" id="signUp" onClick={signUpButton}>Sign Up</button>
			</div>
		</div>
	</div>
</div>

<footer>
	<p>
		Created with <i class="fa fa-heart"></i> by
		<a target="_blank" href="https://freewebsitecode.com">Free Website Code</a>
		- Join our Social Media to Get Daily Update
		<a target="_blank" href="https://www.facebook.com/groups/freewebsitecode">here</a>.
	</p>
</footer>

  {/* <script  src="index.js"></script> */}

	
    </>
	
  )
}





export default Login
